{noformat}// MeasureRelayTripTime measures the duration it takes for the main relay to open/close
// by reading the verivolt grid and inverter voltage measurements, and stopping the trip timer
// when the logic condition is met, and returns the duration.
// nolint gocyclo function is complex because it checks both open/close instances.WIP
func MeasureRelayTripTime(open bool, logger *zap.Logger,
	loopDuration time.Duration) (time.Duration, error) {
	logger.Info("measuring_time_it_takes_the_main_relay_to_trip") // use current instead

	const (
		_relayTripTolerancePu float64 = 0.01 // 1% tolerance for now.
	)

	var (
		gridVoltageData map[string]float64
		gridVoltageL1   float64
		gridVoltageL2   float64
		invVoltageData  map[string]float64
		invVoltageL1    float64
		invVoltageL2    float64
		tripTimerStart  time.Time
		duration        time.Duration
		err             error
	)

	gridSignals := []string{
		VvGridL1SignalVolts, // verivolt grid L1-N voltage.
		VvGridL2SignalVolts, // verivolt grid L2-N voltage.
	}

	inverterSignals := []string{
		VvInvL1SignalVolts, // verivolt inverter L1-N voltage.
		VvInvL2SignalVolts, // verivolt inverter L2-N voltage.
	}

	loopTimerStart := time.Now()
	relayTransitionObserved := false

	if open {
		logger.Info("measuring_time_it_takes_the_main_relay_to_trip_open")
		for time.Since(loopTimerStart) < loopDuration {
			gridVoltageData, err = ReadSignal(gridSignals, ReadSignalDuration, logger)
			if err != nil {
				logger.Error("failed_to_read_signal", zap.Error(err))
				return 0, fmt.Errorf("failed_to_read_signal")
			}
			gridVoltageL1 = gridVoltageData[VvGridL1SignalVolts]
			gridVoltageL2 = gridVoltageData[VvGridL2SignalVolts]

			invVoltageData, err = ReadSignal(inverterSignals, ReadSignalDuration, logger)
			if err != nil {
				logger.Error("failed_to_read_signal", zap.Error(err))
				return 0, fmt.Errorf("failed_to_read_signal")
			}
			invVoltageL1 = invVoltageData[VvInvL1SignalVolts]
			invVoltageL2 = invVoltageData[VvInvL2SignalVolts]

			deltaGridL1 := gridVoltageL1 * _relayTripTolerancePu
			deltaGridL2 := gridVoltageL2 * _relayTripTolerancePu

			if invVoltageL1 > gridVoltageL1+deltaGridL1 ||
				invVoltageL1 < math.Abs(-gridVoltageL1-deltaGridL1) ||
				invVoltageL2 > gridVoltageL2+deltaGridL2 ||
				invVoltageL2 < math.Abs(-gridVoltageL2-deltaGridL2) {
				relayTransitionObserved = true
				logger.Info("open_relay_condition_met")
				break
			}
			tripTimerStart = time.Now()

			if invVoltageL1 > AcVoltageMinGood ||
				invVoltageL2 > AcVoltageMinGood {
				logger.Info("trip_timer_stopped")
				break
			}
			time.Sleep(BusyWaitingDelay)
		}
		realDuration := time.Since(tripTimerStart)
		duration := realDuration.Milliseconds()
		logger.Info("time_taken_to_meet_open_relay_recondition", zap.Int64("duration", duration))

	} else {
		logger.Info("measuring_time_it_takes_the_main_relay_to_close")
		for time.Since(loopTimerStart) < loopDuration {
			gridVoltageData, err = ReadSignal(gridSignals, ReadSignalDuration, logger)
			if err != nil {
				logger.Error("failed_to_read_signal", zap.Error(err))
				return 0, fmt.Errorf("failed_to_read_signal")
			}
			gridVoltageL1 = gridVoltageData[VvGridL1SignalVolts]
			gridVoltageL2 = gridVoltageData[VvGridL2SignalVolts]

			deltaGridL1 := gridVoltageL1 * _relayTripTolerancePu
			deltaGridL2 := gridVoltageL2 * _relayTripTolerancePu

			invVoltageData, err = ReadSignal(inverterSignals, ReadSignalDuration, logger)
			if err != nil {
				logger.Error("failed_to_read_signal", zap.Error(err))
				return 0, fmt.Errorf("failed_to_read_signal")
			}
			invVoltageL1 = invVoltageData[VvInvL1SignalVolts]
			invVoltageL2 = invVoltageData[VvInvL2SignalVolts]

			if invVoltageL1 <= gridVoltageL1+deltaGridL1 &&
				invVoltageL1 >= math.Abs(-gridVoltageL1-deltaGridL1) &&
				invVoltageL2 <= gridVoltageL2+deltaGridL2 &&
				invVoltageL2 >= math.Abs(-gridVoltageL2-deltaGridL2) {
				relayTransitionObserved = true
				logger.Info("closed_relay_condition_met")
				break
			}
			tripTimerStart = time.Now()

			if invVoltageL1 > AcVoltageMinGood ||
				invVoltageL2 > AcVoltageMinGood {
				logger.Info("trip_timer_stopped")
				break
			}
			time.Sleep(BusyWaitingDelay)
		}
		realDuration := time.Since(tripTimerStart)
		duration := realDuration.Milliseconds()
		logger.Info("time_taken_to_meet_closed_relay_recondition", zap.Int64("duration", duration))
	}

	// Return if the condition is not met within loopDuration.
	if !relayTransitionObserved {
		return 0, fmt.Errorf("relay_condition_not_met_within_allowed_duration")
	}

	return duration, nil
}{noformat}
